import './App.css';
import imgIcon from "./utils/images/hospital-icon.png";
import Handles from "./utils/handles";
import Table from "./utils/components/Table";
import EditPopup from "./utils/components/EditPopup";
import { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const { handleChangeValues, handleSend, handleEdit, handleDelete } = Handles();
  const [patientsTable, setPatientsTable] = useState([]);
  const [editOpen, setEditOpen] = useState(false);
  const [deleteOpen, setDeleteOpen] = useState(false);

  useEffect(() => {
    axios.get("http://localhost:3001").then((response) => {
      setPatientsTable(response.data);
    })
  }, []);

  return (
    <body>

      <div className="table-container">
        <Table
          patientsList={ patientsTable }
        />
      </div>
      <EditPopup
        currentPatient={ patientsTable }
        className="edit-popup"
        editOpen={ editOpen }
      />
    </body>
  );
}

export default App;
